import React, { Component } from "react";

export default class Dashboard extends Component {
    clicked() {
        return
    }
    render() {
        return (
            <div>
                <button onClick={this.clicked} className="nav-link px-3">
                    Start the Quiz
                </button>
            </div>
        );
    }
}
